import React from 'react';

import { BrowserRouter as Router, Route } from 'react-router-dom';

//import App from './component';

import Join from './components/Join';
import Chat from './components/Chat';



// When user logs into chat he will be greeted with the join component
//The user will be able to pass in their data through query strings
//Finally the data will be passed to the chat via "chat field"
//Therefore rendering the chat component 
const App = () => ( <
    Router >
    <
    Route path = "/"
    exact component = { Join }
    /> <
    Route path = "/chat"
    component = { Chat }
    /> <
    /Router>
);

export default App;
